import React , {Component} from 'react'
import Child from './Child'
import Items from './Items'

var i = 0;
class App extends Component{
    state = {
        items :[
            {id:1, name :'sayed', age : 21},
            {id:2, name :'Ahmed', age : 10}
        ]
    }

    render(){
        return(
            <div>              
                <Items items={this.state.items}/>
            </div>
        );
    }
}

export default App
